er the expiration or earlier termination of your account and any other provisions hereof, the nature and intent of which is to survive termination or expiration, will survive.\n\n17. PRIVACY POLICY\nPlease review our Privacy Policy, located at https://foundationdevices.com/privacy, which governs the use of personal information.\n\n18. DISPUTE RESOLUTION\nPlease read the following arbitration agreement in this section (“Arbitration Agreement”) carefully. It requires U.S. users to arbitrate disputes with Foundation Devices and limits the manner in which you can seek relief from us.\n\n(a) Applicability of Arbitration Agreement. You agree that any dispute, claim, or request for relief relating in any way to your use of Passport will be resolved by binding arbitration, rather than in court, except that (a) you may assert claims or seek relief in small claims court if your claims qualify; and (b) you or we may seek equitable relief in court for infringement or other misuse of intellectual property rights (such as trademarks, trade dress, domain names, trade secrets, copyrights, and patents). This Arbitration Agreement shall apply, without limitation, to all disputes or claims and requests for relief that arose or were asserted before the effective date of this Agreement or any prior version of this Agreement.\n\n(b) Arbitration Rules and Forum. The Federal Arbitration Act governs the interpretation and enforcement of this Arbitration Agreement. To begin an arbitration proceeding, you must send a letter requesting arbitration and describing your dispute or claim or request for relief to our registered agent. The arbitration will be conducted by JAMS, an established alternative dispute resolution provider. Disputes involving claims, counterclaims, or request for relief under \$250,000, not inclusive of attorneys’ fees and interest, shall be subject to JAMS’s most current version of the Streamlined Arbitration Rules and procedures available at https://jamsadr.com/rules-streamlined-arbitration/; all other disputes shall be subject to JAMS’s most current version of the Comprehensive Arbitration Rules and Procedures, available at https://jamsadr.com/rules-comprehensive-arbitration/. JAMS’s rules are also available at https://jamsadr.com or by calling JAMS at 800-352-5267. If JAMS is not available to arbitrate, the parties will select an alternative arbitral forum. If the arbitrator finds that you cannot afford to pay JAMS’s filing, administrative, hearing and/or other fees and cannot obtain a waiver from JAMS, Company will pay them for you. In addition, Company will reimburse all such JAMS’s filing, administrative, hearing and/or other fees for disputes, claims, or requests for relief totaling less than \$10,000 unless the arbitrator determines the claims are frivolous.\n\nYou may choose to have the arbitration conducted by telephone, based on written submissions, or in person in the country where you live or at another mutually agreed location. Any judgment on the award rendered by the arbitrator may be entered in any court of competent jurisdiction.\n\n(c) Authority of Arbitrator. The arbitrator shall have exclusive authority to (a) determine the scope and enforceability of this Arbitration Agreement and (b) resolve any dispute related to the interpretation, applicability, enforceability or formation of this Arbitration Agreement including, but not limited to, any assertion that all or any part of this Arbitration Agreement is void or voidable. The arbitration will decide the rights and liabilities, if any, of you and Company. The arbitration proceeding will not be consolidated with any other matters or joined with any other cases or parties. The arbitrator shall have the authority to grant motions dispositive of all or part of any claim. The arbitrator shall have the authority to award monetary damages and to grant any non-monetary remedy or relief available to an individual under applicable law, the arbitral forum’s rules, and the Agreement (including the Arbitration Agreement). The arbitrator shall issue a written award and statement of decision describing the essential findings and conclusions on which the award is based, including the calculation of any damages awarded. The arbitrator has the same authority to award relief on an individual basis that a judge in a court of law would have. The award of the arbitrator is final and binding upon you and us.\n\n(d) Waiver of Jury Trial. YOU AND COMPANY HEREBY WAIVE ANY CONSTITUTIONAL AND STATUTORY RIGHTS TO SUE IN COURT AND HAVE A TRIAL IN FRONT OF A JUDGE OR A JURY. You and Company are instead electing that all disputes, claims, or requests for relief shall be resolved by arbitration under this Arbitration Agreement, except as specified in Section 10(a) (Application of Arbitration Agreement) above. An arbitrator can award on an individual basis the same damages and relief as a court and must follow this Agreement as a court would. However, there is no judge or jury in arbitration, and court review of an arbitration award is subject to very limited review.\n\n(e) Waiver of Class or Other Non-Individualized Relief. ALL DISPUTES, CLAIMS, AND REQUESTS FOR RELIEF WITHIN THE SCOPE OF THIS ARBITRATION AGREEMENT MUST BE ARBITRATED ON AN INDIVIDUAL BASIS AND NOT ON A CLASS OR COLLECTIVE BASIS, ONLY INDIVIDUAL RELIEF IS AVAILABLE, AND CLAIMS OF MORE THAN ONE CUSTOMER OR USER CANNOT BE ARBITRATED OR CONSOLIDATED WITH THOSE OF ANY OTHER CUSTOMER OR USER. If a decision is issued stating that applicable law precludes enforcement of any of this section’s limitations as to a given dispute, claim, or request for relief, then such aspect must be severed from the arbitration and brought into the State or Federal Courts located in the Commonwealth of Massachusetts. All other disputes, claims, or requests for relief shall be arbitrated.\n\n(f) 30-Day Right to Opt Out. You have the right to opt out of the provisions of this Arbitration Agreement by sending written notice of your decision to opt out to: hello@foundationdevices.com, within thirty (30) days after first becoming subject to this Arbitration Agreement. Your notice must include your name and address, your Company username (if any), the email address you used to set up your Company account (if you have one), and an unequivocal statement that you want to opt out of this Arbitration Agreement. If you opt out of this Arbitration Agreement, all other parts of this Agreement will continue to apply to you. Opting out of this Arbitration Agreement has no effect on any other arbitration agreements that you may currently have, or may enter in the future, with us.\n\n(g) Severability. Except as provided in Section 10(e)(Waiver of Class or Other Non-Individualized Relief), if any part or parts of this Arbitration Agreement are found under the law to be invalid or unenforceable, then such specific part or parts shall be of no force and effect and shall be severed and the remainder of the Arbitration Agreement shall continue in full force and effect.\n\n(h) Survival of Agreement. This Arbitration Agreement will survive the termination of your relationship with Company.\n\nModification. Notwithstanding any provision in this Agreement to the contrary, we agree that if Company makes any future material change to this Arbitration Agreement, you may reject that change within thirty (30) days of such change becoming effective by writing Company at the following address: Foundation Devices, Inc., 6 Liberty Square #6018, Boston, MA 02109, Attn: CEO.\n\n19. GENERAL\n(a) Changes to Terms of Use. This Agreement is subject to occasional revision, and if we make any substantial changes, we may notify you by sending you an e-mail to the last e-mail address you provided to us (if any) and/or by prominently posting notice of the changes on our website. Any changes to this agreement will be effective upon the earlier of thirty (30) calendar days following our dispatch of an e-mail notice to you (if applicable) or thirty (30) calendar days following our posting of notice of the changes on our website. These changes will be effective immediately for new users of our website. You are responsible for providing us with your most current e-mail address. In the event that the last e-mail address that you have provided us is not valid, or for any reason is not capable of delivering to you the notice described above, our dispatch of the e-mail containing such notice will nonetheless constitute effective notice of the changes described in the notice. Continued use of Passport following notice of such changes will indicate your acknowledgement of such changes and agreement to be bound by the terms and conditions of such changes.\n\nChoice Of Law. The Agreement is made under and will be governed by and construed in accordance with the laws of the Commonwealth of Massachusetts, consistent with the Federal Arbitration Act, without giving effect to any principles that provide for the application of the law of another jurisdiction.\n\n(b) Entire Agreement. This Agreement constitutes the entire agreement between you and us regarding the use of Passport. Our failure to exercise or enforce any right or provision of this Agreement will not operate as a waiver of such right or provision. The section titles in this Agreement are for convenience only and have no legal or contractual effect. The word including means including without limitation. If any provision of this Agreement is, for any reason, held to be invalid or unenforceable, the other provisions of this Agreement will be unimpaired and the invalid or unenforceable provision will be deemed modified so that it is valid and enforceable to the maximum extent permitted by law. Your relationship to us is that of an independent contractor, and neither party is an agent or partner of the other. This Agreement, and your rights and obligations herein, may not be assigned, subcontracted, delegated, or otherwise transferred by you without our prior written consent, and any attempted assignment, subcontract, delegation, or transfer in violation of the foregoing will be null and void. The terms of this Agreement will be binding upon assignees.\n\n(c) Copyright/Trademark Information. Copyright © 2020, Foundation Devices, Inc. All rights reserved. All trademarks, logos and service marks displayed on the Site are our property or the property of other third parties. You are not permitted to use such trademarks, logos and service marks without our prior written consent or the consent of such third party which may own the Marks.\n\nContact Information:\n\nFoundation Devices, Inc.\n6 Liberty Square #6018\nBoston, MA 02109\nhello@foundationdevices.com"),
        "envoy_faq_answer_1": MessageLookupByLibrary.simpleMessage(
            "Envoy es una cartera móvil de Bitcoin y una aplicación complementaria a Passport, disponible en iOS y Android."),
        "envoy_faq_answer_10": MessageLookupByLibrary.simpleMessage(
            "No, cualquiera puede descargar, verificar e instalar manualmente firmware nuevo. Ver [[aquí]] para más información."),
        "envoy_faq_answer_11": MessageLookupByLibrary.simpleMessage(
            "Por supuesto, no hay límite a la cantidad de Passports que puedes gestionar o con las que interactuar utilizando Envoy."),
        "envoy_faq_answer_12": MessageLookupByLibrary.simpleMessage(
            "Sí, Envoy facilita la gestión de múltiples cuentas."),
        "envoy_faq_answer_13": MessageLookupByLibrary.simpleMessage(
            "Envoy se comunica principalmente a través de códigos QR, pero las actualizaciones de firmware se transmiten desde tu teléfono utilizando una tarjeta microSD. Passport incluye adaptadores de microSD para tu teléfono."),
        "envoy_faq_answer_14": MessageLookupByLibrary.simpleMessage(
            "Sí, simplemente ten en cuenta que cualquier información específica de la cartera, como las etiquetas de dirección o notas de transacciones, no se copiarán hacia o desde Envoy."),
        "envoy_faq_answer_15": MessageLookupByLibrary.simpleMessage(
            "Es posible, ya que la mayoría de las carteras hardware que utilizan códigos de QR se comunican de manera muy similar. Sin embargo, no es algo que esté explícitamente soportado. Como Envoy es de código abierto, ¡invitamos a otras carteras hardware basadas en QR que añadan el soporte!"),
        "envoy_faq_answer_16": MessageLookupByLibrary.simpleMessage(
            "De momento, Envoy solo funciona con Bitcoin \'onchain\'. Planeamos soportar Lightning en el futuro."),
        "envoy_faq_answer_17": MessageLookupByLibrary.simpleMessage(
            "Cualquier persona que encuentre tu teléfono, primero tendría que superar el código PIN del sistema operativo de tu teléfono o la autenticación biométrica para acceder a Envoy. En el improbable caso de que logren esto, el atacante podría enviar fondos desde tu Cartera Móvil de Envoy y ver la cantidad de Bitcoin almacenada en cualquier cuenta de Passport conectada. Sin embargo, estos fondos de Passport no estrían en peligro ya que cualquier transacción debe ser autorizada por el dispositivo Passport emparejado."),
        "envoy_faq_answer_18": MessageLookupByLibrary.simpleMessage(
            "Si se utiliza con un Passport, Envoy actúa como una cartera de \'solo lectura\' conectada a tu cartera hardware. Esto significa que Envoy puede preparar transacciones, pero son inútiles sin la autorización relevante, que solo Passport puede proporcionar. Passport es el \'almacenamiento en frío\', ¡y Envoy es simplemente la interfaz conectada a Internet! Si utilizas Envoy para crear una cartera móvil, donde la semilla se almacena de forma segura en tu teléfono, esa cartera móvil no se consideraría almacenamiento en frío. Esto no tiene ningún efecto en la seguridad de las cuentas conectadas a Passport."),
        "envoy_faq_answer_19": MessageLookupByLibrary.simpleMessage(
            "Sí, Envoy se conecta utilizando el protocolo del servidor Electrum. Para conectarte a tu propio servidor Electrum, escanea el código QR o escribe la URL proporcionada en la configuración de red en Envoy."),
        "envoy_faq_answer_2": MessageLookupByLibrary.simpleMessage(
            "Envoy está diseñada para ser la cartera de Bitcoin más fácil de utilizar, sin comprometer tu privacidad. Con las Copias de Seguridad Mágicas de Envoy, puedes configurar una cartera móvil de Bitcoin en 60 segundos, ¡sin palabras semilla y custodiada por ti! Los usuarios de Passport pueden conectar sus dispositivos a Envoy para una configuración fácil, actualizaciones de firmware y una experiencia sencilla de cartera de Bitcoin."),
        "envoy_faq_answer_20": MessageLookupByLibrary.simpleMessage(
            "Descargar e instalar Envoy no requiere ningún dato personal y Envoy puede conectarse a Internet a través de Tor, un protocolo que preserva la privacidad. Esto significa que Foundation no tiene forma de saber quién eres. Envoy también brinda a los usuarios más avanzados la capacidad de conectarse a su propio nodo de Bitcoin para eliminar cualquier dependencia de los servidores de Foundation por completo."),
        "envoy_faq_answer_21": MessageLookupByLibrary.simpleMessage(
            "Sí. A partir de la versión 1.4.0, Envoy permite hacer una selección completa de monedas, así como el \'etiquetado\' de monedas."),
        "envoy_faq_answer_22": MessageLookupByLibrary.simpleMessage(
            "En este momento Envoy no admite gastos por lotes (\"Batch spending\")."),
        "envoy_faq_answer_23": MessageLookupByLibrary.simpleMessage(
            "Sí. A partir de la versión 1.4.0, Envoy permite personalizar la tasa de transacción totalmente, y mantiene dos opciones rápidas de selección de tasa: \'Estándar\' y \'Más rápido\'. \'Estándar\' tiene como objetivo finalizar tu transacción en un plazo de 60 minutos y \'Más rápido\' en unos 10 minutos. Estas son estimaciones basadas en la congestión de la red en el momento en que se construye la transacción y siempre se te mostrará el coste de cada una de las opciones antes de finalizar la transacción."),
        "envoy_faq_answer_3": MessageLookupByLibrary.simpleMessage(
            "Envoy es una cartera de Bitcoin simple con funciones potentes de gestión de cuentas y privacidad, incluyendo Copias de Seguridad Mágicas. Usa Envoy junto con tu Passport para su configuración, actualizaciones de firmware y más."),
        "envoy_faq_answer_4": MessageLookupByLibrary.simpleMessage(
            "La Copia de Seguridad Mágica es la forma más fácil de configurar y hacer una copia de seguridad de una cartera móvil de Bitcoin. La Copia de Seguridad Mágica almacena la semilla de tu cartera móvil encriptada de extremo a extremo en tu llavero iCloud o copia de seguridad de Android. Todos los datos de la aplicación están encriptados por tu semilla y se almacenan en los servidores de Foundation. ¡Configura tu cartera en 60 segundos y restáurala automáticamente si pierdes tu teléfono!"),
        "envoy_faq_answer_5": MessageLookupByLibrary.simpleMessage(
            "Las Copias de Seguridad Mágicas son completamente opcionales para los usuarios que deseen utilizar Envoy como cartera móvil. Si prefieres gestionar tus propias palabras semilla y copias de seguridad de la cartera móvil, elige \'Configurar Semilla Manualmente\' en la etapa de configuración de la cartera."),
        "envoy_faq_answer_6": MessageLookupByLibrary.simpleMessage(
            "La Copia de Seguridad de Envoy contiene la configuración de la aplicación, información sobre la cuenta, etiquetas y notas de las transacciones. El archivo está encriptado con las palabras semilla de tu cartera móvil. Para los usuarios que habiliten la Copia de Seguridad Mágica, toda esta información se almacena completamente encriptada en el servidor de Foundation. Los usuarios de Envoy que hayan decidido gestionar las palabras semilla de forma manual, pueden descargar y almacenar su copia de seguridad donde deseen. Esto podría ser cualquiera, o múltiples, de las siguientes opciones: un teléfono, un servidor de nube personal, o algún dispositivo físico como una tarjeta microSD o un dispositivo de almacenamiento USB."),
        "envoy_faq_answer_7": MessageLookupByLibrary.simpleMessage(
            "No, las características principales de Envoy siempre serán gratuitas. En el futuro es posible que introduzcamos servicios o suscripciones opcionales de pago."),
        "envoy_faq_answer_8": MessageLookupByLibrary.simpleMessage(
            "Sí, al igual que todo lo que hacemos en Foundation, Envoy es completamente de código abierto. Envoy tiene la misma licencia [[GPLv3]] que nuestro Firmware de Passport. Para aquellos que deseen verificar nuestro código fuente, pueden hacer clic [[aquí]]."),
        "envoy_faq_answer_9": MessageLookupByLibrary.simpleMessage(
            "No, nos enorgullecemos de garantizar que Passport sea compatible con tantas carteras de software diferentes como sea posible. Puedes ver nuestra lista completa, incluidos los tutoriales, [[aquí]]."),
